PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

DELETE { ?s ?p ?amount . }
INSERT { ?s ?p ?amountFixed . }
WHERE {
  ?s ?p ?amount .
  FILTER(datatype(?amount) = xsd:decimal)
  FILTER(REGEX(str(?amount), "^[0-9.]+,[0-9]{1,2}$")) .
  BIND(REPLACE(str(?amount), "\\.", "") AS ?tmp1)
  BIND(REPLACE(str(?tmp1), ",", ".") AS ?tmp)
  BIND(STRDT(?tmp, xsd:decimal) AS ?amountFixed)
}
